import React from 'react'

// deconstructed props
function Person({person:{id, name, email, gender, status} }) {

  return (
        <tr key={id}>
            <td>{id}</td>
            <td>{name}</td>
            <td>{email}</td>
            <td>{gender}</td>
            <td>{status}</td>
            <td><button>Edit</button></td>
        </tr>
  )
}
export default Person
